<body>
    <div id="topbar">
        <button id="speedBackward" class="playback">&lt;&lt;</button>
        <button id="play" class="playback">&gt;</button>
        <button id="pause" class="playback">| |</button>
        <button id="speedForward" class="playback">&gt;&gt;</button>
        <p id="timer">0:00 / 14:ish</p>

        <select id="performerMenu" name="Performer" autocomplete="off" onchange="loadPerformer()">
            <option value="allParts" selected>All Parts</option>
            <option value="bassPerformer">Bass</option>
            <option value="performer1">Violin 1</option>
            <option value="performer2">Violin 2</option>
            <option value="performer3">Viola</option>
            <option value="performer4">Cello</option>
        </select>

        <!-- <button id="performerLoad">Load Part</button> -->

        <select id="rehearsalMarkMenu" name="Rehearsal Marks">
            <option value="0" selected>Rehearsal Marks</option>
            <option value="R0">Start</option>
            <option value="R1">R1</option>
            <option value="R2">R2</option>
            <option value="R3">R3</option>
            <option value="R4">R4</option>
            <option value="R5">R5</option>
        </select>
        <button id="rehearsalMarkSeek">Goto Mark</button>

        <input type="checkbox" name="conductor?" id="conductorSelect" autocomplete="off">conductor?</select>
        <button id="performanceNotesButton">performance notes</button>
        <!-- <p id="debugPlayValue">deee</p> -->
        <p id="conductorText"></p>
        
    </div>

    <div id="performanceNotesDisplay" class="hidden">
        <!-- This gets the inline svg for performance notes injected in on button press -->
    </div>

        <!-- floating dynamic display on full score, text for now, class .hidden if part != allParts -->

            <p id="part2Float"></p>
            <p id="part3Float"></p>
            <p id="part4Float"></p>
        </div>
